Toner Tips Tuesday! 

Many IG skin pros might disagree but I believe that a toner is oftentimes the most important step that my clients are missing in their routine. 

But not all toners are created equal. Avoid the ones that are drying and opt for a hydration base to help support many integral functions of the skin. 

Some favorites include:
@linnebotanicals refresh mist -> full of trace minerals for the skin
@odacite aloe and immortelle hydra toe -> my go-to for inflamed skin
@apoterra neroli clarifying complexion mist -> a serum in a toner with a based of green tea to soothe and willow bark to target breakouts 
@joshrosebrook hydrating accelerator-> packed with antioxidants in a soothing base of aloe water 
@laurelskin hydrating elixir 2 -> to soothe complexions from irritated states

But y’all, a healthy dose of rose water does the trick too! Do you use a toner in your routine??

