My top 3 facial mask picks for the winter months.

@mvskintherapy signature mask is one of my longtime favorites for sensitive, reactive, break out prone skin. Which a lot of us experience in the winter 🥶 

Simply mix a heaping tbsp with some warm water and stir until creamy. Leave on for about 10-15 minutes and remove with a warm (not hot) facial compress. 

@activistmanuka mask is a staple year round but I see so many clients who could especially use the manuka benefits in the winter. Naturally enzymatic and humectant to help with hydration loss during winter months. The manuka benefits are endless for internal use as well!
Apply on clean skin or use as a cleanser by adding water. 

@co2lift is a wonderful addition to your holiday gifts because it’s a perfect pick me up right before a holiday party! Your skins thirst will be quenched and you’ll also be forced into a 45-60 minute pause of self care as that’s how long this mask needs to stay on for full effect. Mix the two packets together and enjoy the goopy goodness! 

